import React from 'react'

const Modaldelete = ({
    openmodal,
    handlemodalopen,
    handlemodalclose,
    deletemodal,
    modaldelete
  }) => {
    Modal.setAppElement("#root");
    const customStyles = {
      content: {
        top: "50%",
        left: "50%",
        right: "auto",
        bottom: "auto",
        marginRight: "-50%",
        transform: "translate(-50%, -50%)",
      },
    };
    //   console.log(isopen)
    return (
      <div>
        <Modal
          isOpen={openmodal}
          onRequestClose={handlemodalclose}
          style={customStyles}
          contentLabel="Example Modal"
        >
          <div className="box-modal">
          <button>Delete ? </button>
          <button>Ca</button>
          </div>
          
        </Modal>
      </div>
    );
  };
export default Modaldelete
